pragma solidity ^0.8.7;

import "./VerifyBytes.sol";

contract MachoVerse {

    constructor(address _verificationAddress){
        verificationAddress = _verificationAddress;
    }

    address verificationAddress;

    mapping (uint256 => TokenType) private _tokenIdToTokenType;

    mapping (address => mapping(uint256 => uint256)) private _accountToTokenBalances;

    mapping(uint256 => uint256) private _totalTokens;

    mapping(address => mapping(uint256 => bool)) private _accountNonces;

    uint256 public val;

    ClaimInfo public info;

    enum TokenType {
        ERC20,
        ERC721,
        ERC1155
    }

    struct MintInfo {
        uint256 tokenId;
        uint256 amount;
    }

    struct ClaimInfo {
        address minter;
        uint256 validTill;
        uint256 nonce;
        MintInfo[] mintingDetails;
    }

    uint256 public mintTime;

    event MintClaimed(address account, uint256 nonce);

    function mintTokens(bytes memory message, bytes memory signature) external
    {
        VerifyBytes verificationContract = VerifyBytes(verificationAddress);
        require(verificationContract.verify(message, signature), "MachoVerse: Invalid minting message!");
        (address minter, uint256 validTill, uint256 nonce, MintInfo[] memory mintingDetails) = decodeClaimInfo(message);
        require(msg.sender == minter, "MachoVerse: This is not your mint.");
        require(!_accountNonces[msg.sender][nonce], "MachoVerse: This mint has already been claimed.");
        require(block.timestamp < validTill, "MachoVerse: This mint has expired, please create another mint.");
        mintTime = validTill;
        processMint(mintingDetails);
        _accountNonces[msg.sender][nonce] = true;
        emit MintClaimed(msg.sender, nonce);
    }

    function decodeClaimInfo(bytes memory message) internal pure returns (address, uint256, uint256, MintInfo[] memory)
    {
        return abi.decode(message, (address, uint256, uint256, MintInfo[])); //ClaimInfo struct
    }

    function processMint(MintInfo[] memory mintInfo) internal 
    {
        for(uint256 i = 0; i < mintInfo.length; i++)
        {
            _accountToTokenBalances[msg.sender][mintInfo[i].tokenId] = mintInfo[i].amount;
        }
    }

    function viewBalance(address account, uint256 tokenId) external view returns (uint256)
    {
        return _accountToTokenBalances[account][tokenId];
    }

    function deleteAccountNonces(address account, uint256 numNonces) external {
        for(uint i = 0; i < numNonces; i++){
            delete _accountNonces[account][i];
        }
    }
